  color = 'gray';

  agInit(params: any): void {
    const value = params.value?.toLowerCase();
    if (value === 'active') this.color = 'green';
    else if (value === 'pending') this.color = 'orange';
    else if (value === 'error') this.color = 'red';
    else if (value === 'closed') this.color = 'gray';
  }

  refresh(): boolean {
    return false;
  }

}

